import React, {Component} from 'react';

class GitDescription extends Component {

  constructor() {
    super();
    this.state = {
      shown: true
    };
  }

  toggle() {
    this.setState({
      shown: !this.state.shown
    });
  }

  state = {
    try: [
      {
        title: 'git config',
        description: 'This command sets the author name and email address respectively to be used with your commits.',
        cli: 'git config'
      }, {
        title: 'Second Command',
        description: 'With supporting text below as a natural lead-in to additional content.',
        cli: 'git-pull'
      }
    ]
  }

  render() {
    var shown = {
      display: this.state.shown
        ? "block"
        : "none"
    };

    var hidden = {
      display: this.state.shown
        ? "none"
        : "block"
    }

    return (<div key={index}>
      <h2 style={shown}>Naveen</h2>
      <h2 style={hidden}>              {firstSection}
</h2>
      <button onClick={this.toggle.bind(this)}>Toggle</button>
    </div>)
  }
}

export default GitDescription;
